/*Table structure for table `pacientes` */

DROP TABLE IF EXISTS `pacientes`;

CREATE TABLE `pacientes` (
  `id_paciente` int(11) NOT NULL AUTO_INCREMENT,
  `nom_paciente` varchar(30) DEFAULT NULL,
  `ap_paciente` varchar(30) DEFAULT NULL,
  `am_paciente` varchar(30) DEFAULT NULL,
  `curp` varchar(20) DEFAULT NULL,
  `edad` int(30) DEFAULT NULL,
  `fecha_nacimiento` date DEFAULT NULL,
  `sexo` varchar(20) DEFAULT NULL,
  `afiliacion_seguro` varchar(30) DEFAULT NULL,
  `num_afiliacion` int(30) DEFAULT NULL,
  `nom_vialidad` varchar(30) DEFAULT NULL,
  `tipo_vialidad` varchar(30) DEFAULT NULL,
  `num_int` int(11) DEFAULT NULL,
  `num_ext` int(11) DEFAULT NULL,
  `nombre_asentamiento` varchar(30) DEFAULT NULL,
  `tipo_asentamiento` varchar(30) DEFAULT NULL,
  `cp` int(11) DEFAULT NULL,
  `localidad` varchar(30) DEFAULT NULL,
  `telefono` int(20) DEFAULT NULL,
  `ExpedienteD` varchar(2) DEFAULT NULL,
  `id_municipio` int(11) DEFAULT NULL,
  `id_estado` int(11) DEFAULT NULL,
  `remember_token` varchar(100) DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `deleted_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id_paciente`),
  KEY `id_municipi` (`id_municipio`),
  KEY `id_estado` (`id_estado`),
  CONSTRAINT `id_municipi` FOREIGN KEY (`id_municipio`) REFERENCES `municipios` (`id_municipio`),
  CONSTRAINT `pacientes_ibfk_1` FOREIGN KEY (`id_estado`) REFERENCES `estados` (`id_estado`)
) ENGINE=InnoDB AUTO_INCREMENT=51 DEFAULT CHARSET=utf8;

